import React, { Component } from 'react';
import logo from './img/logo.png'
import foto1 from './img/back.png'

class ConferenceForm extends Component {
  // ... (tu constructor y otros métodos)

  handleSubmit = (event) => {
    event.preventDefault();

    // Crear un objeto con los datos del formulario
    const formData = {
      nombre: this.state.nombre,
      apellidos: this.state.apellidos,
      pais: this.state.pais,
      afiliacion: this.state.afiliacion,
      correo: this.state.correo,
      telefono: this.state.telefono,
      tipoParticipacion: this.state.tipoParticipacion,
      esMiembroIEEE: this.state.esMiembroIEEE,
      numeroMembresia: this.state.numeroMembresia
    };

    // Realizar una solicitud POST al servidor utilizando fetch
    fetch('/registro', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(formData)
    })
    .then(response => response.json())
    .then(data => {
      // Procesar la respuesta del servidor si es necesario
      console.log('Respuesta del servidor:', data);
    })
    .catch(error => {
      // Manejar errores, si los hay
      console.error('Error al enviar datos al servidor:', error);
    });
  }
  handleInputChange = (event) => {
    const { name, value } = event.target;
    this.setState({ [name]: value });
  }

  handleSubmit = (event) => {
    event.preventDefault();
    // Aquí puedes enviar los datos al servidor o realizar las acciones necesarias
    console.log(this.state);
  }

  render() {
    return (


  <div>  
    <header className="header">
      <div className="logo-container">
     <img src={logo} alt="Logo" className="logo"/>
      </div>
      <div className="register">
        Página de Registro
      </div>
    </header>
    <div class="contenido">
      <div class="formulario">
        <form onSubmit={this.handleSubmit}>
        <label>
            Nombres
            <br />
            <input
              type="text"
              name="nombre"
              value={this.state.nombre}
              onChange={this.handleInputChange}
              required
            />
          </label>
          <br />

          <label>
            Apellidos
            <br />
            <input
              type="text"
              name="apellidos"
              value={this.state.apellidos}
              onChange={this.handleInputChange}
              required
            />
          </label>
          <br />

          <label>
            País
            <br />
           <input
              type="text"
              name="pais"
              value={this.state.pais}
              onChange={this.handleInputChange}
              required
            />
          </label>
          <br />

          <label>
            Afiliación
            <br />
            <input
              type="text"
              name="afiliacion"
              value={this.state.afiliacion}
              onChange={this.handleInputChange}
              required
            />
          </label>
          <br />

          <label>
            Correo electrónico
            <br />
            <input
              type="email"
              name="correo"
              value={this.state.correo}
              onChange={this.handleInputChange}
              required
            />
          </label>
          <br />

          <label>
            Teléfono
            <br />
            <input
              type="tel"
              name="telefono"
              value={this.state.telefono}
              onChange={this.handleInputChange}
              required
            />
          </label>
          <br />

          <label>
            Oficio
            <br />
            <select
              name="tipoParticipacion"
              value={this.state.tipoParticipacion}
              onChange={this.handleInputChange}
            >
              <option value="Estudiante">Estudiante</option>
              <option value="Profesional">Profesional</option>
            </select>
          </label>
          <br />
          <label>
              Miembro IEEE
              <input
                type="checkbox"
                name="esMiembroIEEE"
                checked={this.state.esMiembroIEEE}
                onChange={() => this.setState({ esMiembroIEEE: !this.state.esMiembroIEEE })}
              />
            </label>
            <br />

            {this.state.esMiembroIEEE && (
              <label>
                Número de Membresía IEEE
                <br />
                <input
                  type="text"
                  name="numeroMembresia"
                  value={this.state.numeroMembresia}
                  onChange={this.handleInputChange}
                />
              </label>
            )}
            <br />

          <label>
            Tipo de participación
            <br />
            <input
              type="radio"
              name="tipoParticipacion"
              value="Autor"
              checked={this.state.tipoParticipacion === 'Autor'}
              onChange={this.handleInputChange}
            />
            Autor   
            <input
              type="radio"
              name="tipoParticipacion"
              value="Asistente"
              checked={this.state.tipoParticipacion === 'Asistente'}
              onChange={this.handleInputChange}
            />
            Asistente
          </label>
          <br />

          <button type="submit">Confirmar</button>
        </form>
      </div>
         <div class="fotos">   
        <img src={foto1} alt="foto" className="conferencia"/>
        </div>

    </div>
  </div>
    );
  }
}

export default ConferenceForm;
